import React, { Component } from "react";
import GoogleMapReact from "google-map-react";

let style = {
  color: "black",
  background: "lightgrey",
  padding: "15px 10px",
  display: "inline-flex",
  textAlign: "left",
  alignItems: "center",
  justifyContent: "left",
  borderRadius: "10px",
  transform: "translate(-50%, -50%)",
};

let person1 = {};

const AnyReactComponent = ({ text }) => <div style={style}>{text}</div>;

class SimpleMap extends React.Component {
  static defaultProps = {
    center: { lat: 46.25, lng: 20.15 },
    zoom: 13,
  };

  render() {
    const MapApi = "AIzaSyC-ElJ4eqtnKX5ufH3OXSgCeolthMzqJuw";
    return (
      <GoogleMapReact
        //bootstrapURLKeys={{ key: MapApi }}
        defaultCenter={this.props.center}
        defaultZoom={this.props.zoom}
      >
        <AnyReactComponent lat={46.25} lng={20.15} text={"Hello Map"} />
      </GoogleMapReact>
    );
  }
}

export default SimpleMap;
